import { createSlice, configureStore } from "@reduxjs/toolkit";

import AuthSlice from "./AuthSlice";

import UPIslice from './AuthSlice';

const MainStore = configureStore({
  reducer: { auth: AuthSlice,
  UPI: UPIslice },
});

export default MainStore;
